insert into Product (prodName, price, prodDescription, launchDate, stock, categoryName) values ('Smartphone Samsung Galaxy M23 5G 6.6" 4GB/128GB Dual SIM Azul', '199.90', 'O poder da próxima geração de dados móveis, desde jogos e streaming super fluído, a uploads e downloads super rápidos. Desfrute do processador Octa-core Snapdragon 750G com uma RAM de 4GB, para uma performance mais eficiente. A RAM Plus analisa os seus padrões de utilização e proporciona-lhe RAM virtual extra para não lhe falte fluidez na execução de qualquer tarefaExpanda a sua visão com uma ecrã de 6.6” com tecnologia Full HD+ e uma taxa de atualização de 120Hz para um scroll super fluido.', '2019-11-14', 200, 'Smartphones');
insert into Product (prodName, price, prodDescription, launchDate, stock, categoryName) values ('Smartphone Xiaomi Poco M4 Pro 6.43" 8GB/256GB Dual SIM Power Black', '259.90 ', 'Carga Rápida 33W Pro. O primeiro smartphone POCO da série M com Carga Rápida 33W Pro. A bateria pode ser carregada a 100% em 59 minutos. Graças à bateria de 5000 mAh de alta capacidade, o telefone consome energia lentamente e carrega rapidamente.O ecrã apresenta uma taxa de atualização variável adequada para várias aplicações. É feito de materiais premium e oferece altas taxas de atualização (90 Hz).', '2021-06-18', 200, 'Smartphones');
insert into Product (prodName, price, prodDescription, launchDate, stock, categoryName) values ('Smartphone Apple iPhone 14 Plus 6.7" 128GB', '1189.00', 'iPhone 14 Plus. Pense em grande com um ecrã maior de 6.7 polegadas1 e bateria para todo o dia2. Tire fotografias espetaculares com muita ou pouca luz com o novo sistema de câmara dupla. A nova funcionalidade Deteção de acidente3 pede ajuda por si sempre que não o conseguir fazer.', '2021-07-03', 200, 'Smartphones');
insert into Product (prodName, price, prodDescription, launchDate, stock, categoryName) values ('Smartphone Samsung Galaxy S22 Ultra 5G 6.8" 8GB/128GB Dual SIM Burgundy', '1149.90', 'Não existe um único smartphone que seja perfeito para todos os clientes Por isso, a Samsung criou um Galaxy S22 para cada tipo de cliente. O Galaxy S22 Ultra herda o legado da família Note, integrando a S Pen e mantendo a essência da série Ultra. Os Galaxy S22 | S22+ oferecem uma experiência de câmara completamente renovada e inovadora mantendo uma performance de ponta e um design exclusivo.', '2021-06-18', 200, 'Smartphones');
insert into Product (prodName, price, prodDescription, launchDate, stock, categoryName) values ('Computador Desktop Lenovo Legion T5 26AMR5-205', '1899.90', 'A potência selvagem alia-se à velocidade sem paralelo com o Legion Tower 5 (AMD). Com um desempenho arrebatador, conta com potentes processadores de desktop AMD Ryzen™ e uma placa gráfica NVIDIA® GeForce® de topo para desfrutar de velocidades de fotogramas ultrarrápidas com uma resolução superior a 4K. Superando em muito os limites das plataformas mais pequenas, mantém tudo ultra-arrefecido e silencioso. Globalmente, é uma verdadeira maravilha da construção, do design e da potência de fogo.', '2020-06-01', 200, 'Desktops');
insert into Product (prodName, price, prodDescription, launchDate, stock, categoryName) values ('Computador Desktop MSI MAG Codex 5 12TC-1478ES', '949.90', 'O computador MSI MAG Codex 5 12TC-1478ES foi projetado para gamers, possui processador Intel® Core™ i5-12400F e placa gráfica NVIDIA GeForce RTX, proporcionando a melhor experiência gaming. A solução térmica exclusiva com a melhor refrigeração, oferece o melhor desempenho, enquanto que a iluminação RGB e uma janela lateral com vidro temperado mostram o seu estilo. A série MSI MAG vai levar os gamers a quebrar barreiras.', '2021-11-10', 200, 'Desktops');
insert into Product (prodName, price, prodDescription, launchDate, stock, categoryName) values ('Computador Victus by HP 15L Gaming Desktop TG02-0026np', '899.90', 'Um PC de trabalho. Uma máquina de entretenimento e gaming. Apresentamos o PC Desktop de Gaming Victus by HP 15L, uma máquina capaz de fazer tudo. Joga a sério com um potente processador AMD e gráfica impressionante.', '2021-08-05', 200, 'Desktops');
insert into Product (prodName, price, prodDescription, launchDate, stock, categoryName) values ('Computador All-in-One HP 24-cb0007np', '449.90', 'O PC All-in-One HP combina a potência de um desktop com a beleza de um monitor moderno. Equipado com um processador AMD, um ecrã Full HD de moldura fina em três lados e dois altifalantes, este PC proporciona-lhe uma experiência cinematográfica fabulosa. Este PC All-in-One é constituído por materiais sustentáveis e foi concebido de forma engenhosa com portas devidamente localizadas para manter o seu espaço de trabalho organizado.', '2020-07-31', 200, 'Desktops');
insert into Product (prodName, price, prodDescription, launchDate, stock, categoryName) values ('Apple MacBook Pro 2021 16.2" | M1 Pro CPU 10‑core, GPU 16‑core | SSD 1TB | 16GB RAM', '2999.00', 'Chegou o MacBook Pro mais poderoso de sempre. Tem um gigantesco desempenho e autonomia graças aos processadores ultrarrápidos M1 Pro ou M1 Max, os primeiros concebidos pela Apple a pensar nos profissionais. Depois, conta ainda com um incrível ecrã Liquid Retina XDR e a melhor câmara e som de um portátil Mac, além de todas as portas de que precisa. Este MacBook Pro é verdadeiramente revolucionário e é um colosso.', '2019-10-20', 200, 'Laptops');
insert into Product (prodName, price, prodDescription, launchDate, stock, categoryName) values ('Portátil Lenovo V15 G2 ITL 15.6"', '379.90', 'Pense no Lenovo V15 de 15,6" (39,62 cm) como um gestor de escritório que executa as suas tarefas quotidianas com a máxima eficiência que manterá a produtividade e a segurança dos dados do seu negócio, enquanto o design mais fino e mais compacto, e as molduras laterais mais finas, conferem um aspeto elegante e minimalista ao seu ambiente de trabalho ou onde quer que vá.', '2020-03-08', 200, 'Laptops');
insert into Product (prodName, price, prodDescription, launchDate, stock, categoryName) values ('Portátil MSI 15.6" GF63 Thin 11UC-646XPT', '699.90', 'Equipado com um potente processador Intel® Core™ de 11ª geração, com ganhos de desempenho de até 40% em relação à geração anterior. Obtenha maior potência com este processador, para maximizar a eficiência na jogabilidade, no trabalho multitarefa e na produtividade.', '2021-09-12', 200, 'Laptops');
insert into Product (prodName, price, prodDescription, launchDate, stock, categoryName) values ('Apple MacBook Air 2020 13.3" | M1 CPU 8‑core, GPU 7‑core | SSD 256GB | 8GB RAM', '1189.00', 'A potência do processador M1 da Apple revoluciona por completo o portátil mais fino e leve da Apple. Velocidades da CPU até 3,5 vezes mais rápidas. Velocidades da GPU até 5 vezes mais rápidas. O Neural Engine mais avançado de sempre, para aprendizagem automática até 9 vezes mais rápida. A maior autonomia de sempre num MacBook Air. E um design silencioso, sem ventoinha. Nunca se viu tanta potência junta e tão portátil.', '2021-08-01', 200, 'Laptops');
insert into Product (prodName, price, prodDescription, launchDate, stock, categoryName) values ('Televisão Samsung AU9005 SmartTV 75" LED 4K UHD', '799.90', 'Mergulhe na imagem e nos seus bilhões de tons de cores. O Dynamic Crystal Display cria variações de cores realistas para que possa ver todas as tonalidades.A poderosa tecnologia de escala 4K garante que aproveita tudo o que assiste com qualidade de imagem 4K. Além disso, a tecnologia avançada de Mapeamento de Cores torna as cores mais realistas.', '2022-11-21', 200, 'TVs');
insert into Product (prodName, price, prodDescription, launchDate, stock, categoryName) values ('Televisão LG Série NANO76 SmartTV 55" NanoCell 4K UHD', '499.90', 'Embarque numa nova experiência de cor graças à pureza das TVs NanoCell da LG, com resolução 4K Real.A tecnologia NanoCell da LG usa nanopartículas para filtrar as cores impuras dos comprimentos de onda RGB.', '2022-02-26', 200, 'TVs');
insert into Product (prodName, price, prodDescription, launchDate, stock, categoryName) values ('Televisão Xiaomi TV A2 SmartTV 50" LED 4K UHD Android TV', '399.90', 'O design único da Smart TV A2 oferece uma moldura extremamente fina e uma excelente relação entre a qualidade de ecrã e a visão, muito acima dos padrões que estamos habituados. Vais ser surpreendido a partir do momento em que ligas a tua TV, imagens de alta resolução e cores impressionantes vão cobrir o teu ecrã para que tenhas uma experiência imersiva. Com um design requintado e uma estrutura metálica unibody, a tua Xiaomi TV A2 Series vai realçar-se em tua casa.', '2022-08-30', 200, 'TVs');
insert into Product (prodName, price, prodDescription, launchDate, stock, categoryName) values ('Televisão TCL P735 SmartTV 85" LED 4K UHD Google TV', '1099.90', 'A Alta Gama Dinâmica (HDR), o mais recente padrão para conteúdos UHD, proporciona uma experiência superior com brilho impressionante, detalhes de sombra excepcionais e cores vivas. Sente-se quieto e desfrute de detalhes de imagem incríveis, tal como os realizadores do filme pretendiam.', '2020-04-28', 200, 'TVs');
insert into Product (prodName, price, prodDescription, launchDate, stock, categoryName) values ('Smartphone Apple iPhone 14 Pro Max 6.7" 256GB Roxo Escuro', '1629.00', 'iPhone14 Pro Max. Fotografe detalhes incríveis com a câmara principal de 48MP. A Dynamic Island e o ecrã Sempre ligado reinventam a forma de usar o iPhone. A nova funcionalidade Deteção de acidente1 pede ajuda por si sempre que não o conseguir fazer.', '2022-04-03', 200, 'Smartphones');
insert into Product (prodName, price, prodDescription, launchDate, stock, categoryName) values ('Smartphone Nothing Phone (1) 6.55" 8GB/128GB Dual SIM Preto', '399.90', 'O smartphone Nothing phone (1) é o novo gamechanger. Usando materiais elegantes e de origem responsável e muitos recursos avançados, o phone (1) não é nada além do melhor. Não mais do mesmo já visto noutros smartphones. O phone (1) é feito com pura intenção e paixão.', '2022-02-11', 200, 'Smartphones');
insert into Product (prodName, price, prodDescription, launchDate, stock, categoryName) values ('Smartphone Motorola Moto G22 6.5" 4GB/128GB Dual SIM Preto', '149.90', 'Faça magia visual com o sistema de quatro câmaras de 50 MP. Disparos em baixa luminosidade, primeiros planos detalhados, retratos artísticos e ultragrande angulares - pode tentar tudo.', '2021-02-13', 200, 'Smartphones');
insert into Product (prodName, price, prodDescription, launchDate, stock, categoryName) values ('Smartphone Samsung Galaxy Z Flip 4 6.7" 8GB/128GB Dual SIM Light Blue', '999.90', 'O Galaxy Z Flip 4 é a 4 ª geração de dobráveis da Samsung. Um dispositivo com um design único que não passará despercebido, e que, graças ao seu exclusivo formato dobrável, oferece um novo mundo de possibilidades e funcionalidades que mudarão para sempre a forma como utiliza as apps, tira fotografias e faz vídeos. Dê o salto hoje para o smartphone que sempre sonhou ter.', '2022-04-30', 200, 'Smartphones');
insert into Product (prodName, price, prodDescription, launchDate, stock, categoryName) values ('Smartphone Samsung Galaxy S22 5G 6.1" 8GB/256GB Dual SIM Branco', '799.90', 'Não existe um único smartphone que seja perfeito para todos os clientes Por isso, a Samsung criou um Galaxy S22 para cada tipo de cliente. O Galaxy S22 Ultra herda o legado da família Note, integrando a S Pen e mantendo a essência da série Ultra. Os Galaxy S22 | S22+ oferecem uma experiência de câmara completamente renovada e inovadora mantendo uma performance de ponta e um design exclusivo.', '2021-12-31', 200, 'Smartphones');
insert into Product (prodName, price, prodDescription, launchDate, stock, categoryName) values ('Computador All-In-One Lenovo IdeaCentre AIO 3 27ALC-981', '699.90', 'O IdeaCentre AIO 3 (27") alia a engenharia elegante ao desempenho de excelência. Com um elegante suporte e ecrã de 27" praticamente sem margens, oferece um desempenho de sonho com processador AMD Ryzen™ e memória DDR4 totalmente integrada. E também poupa espaço.', '2020-10-08', 200, 'Desktops');
insert into Product (prodName, price, prodDescription, launchDate, stock, categoryName) values ('Computador Desktop Lenovo IdeaCentre 3 07ADA5-457', '249.90', 'O desktop IdeaCentre 3 (AMD) é uma torre compacta, concebida com um elegante chassis em Cinzento Mineral que cabe e se enquadra na perfeição em qualquer espaço da sua casa. Conta com o excelente desempenho dos processadores AMD e da placa gráfica integrada, bem como com uma grande capacidade de memória, armazenamento e portas para as suas necessidades informáticas do dia a dia.', '2022-07-02', 200, 'Desktops');
insert into Product (prodName, price, prodDescription, launchDate, stock, categoryName) values ('Apple iMac 24" (2021) | M1 CPU 8‑core, GPU 8-core | SSD 512GB | 8GB RAM | Prateado', '1799.00', 'Inspirado no que a Apple tem de melhor e agora com toda a potência do processador M1. Destaca‑se de tudo à sua volta onde quer que o coloque e adapta‑se na perfeição ao seu estilo de vida. O M1 integra o processador, a placa gráfica, a memória e muito mais. De perfil, o computador é tão estreito que quase não se vê. E de frente, não vai conseguir desviar o olhar.', '2021-11-03', 200, 'Desktops');
insert into Product (prodName, price, prodDescription, launchDate, stock, categoryName) values ('MICROSOFT Surface Pro X (14.4" - Intel Core i7-11370H - RAM: 32 GB - 2 TB SSD - NVIDIA GeForce RTX 3050 Ti)', '3249.00', 'Surface Pro X: Até 15 horas de duração da bateria para utilização normal do dispositivo Surface. Testes efetuados pela Microsoft em agosto de 2021 com software de pré-produção e dispositivos de pré-produção Surface Pro X com Microsoft SQ® 1 e Surface Pro X com Microsoft SQ® 2, 256 GB, 8 GB de RAM. Os testes envolveram a descarga completa da bateria com uma mistura de utilização ativa e modo de espera moderno.', '2021-10-17', 200, 'Laptops');
insert into Product (prodName, price, prodDescription, launchDate, stock, categoryName) values ('MICROSOFT Surface Book 3 (15" - Intel Core i7-1065G7 - RAM: 16 GB - 256 GB SSD - NVIDIA GeForce GTX 1660 Ti)', '2649.00', 'O portátil Surface Book 3 é ideal para as tarefas mais exigentes, mais potente de sempre combina velocidade, gráficos e uma experiência de jogo imersiva com toda a versatilidade de um portátil, de um tablet e de um estúdio portátil.Quando a inspiração bate à porta, o Surface Book 3 permite-lhe trabalhar de uma forma fácil, com um ecrã tátil amovível que se transforma num tablet. Maximize a produtividade com o teclado de tamanho integral.', '2021-12-18', 200, 'Laptops');
insert into Product (prodName, price, prodDescription, launchDate, stock, categoryName) values ('Processador Intel Core i5-12400F 6-Core 2.5GHz c/ Turbo 4.4GHz 18MB Skt1700', '216.90', 'Os processadores para desktop Intel® Core™ da 12ª Geração oferecem uma nova arquitetura híbrida de desempenho, combinando núcleos de desempenho com núcleos eficientes para aprimorar jogos, produtividade e criação. Num avanço arrojado no desempenho do núcleo, os processadores para desktop Intel® Core™ da 12ª Geração oferecem uma abordagem revolucionária da arquitetura x86.', '2021-05-23', 200, 'Components');
insert into Product (prodName, price, prodDescription, launchDate, stock, categoryName) values ('Processador AMD Ryzen Threadripper PRO 5995WX 64-Core 2.7GHz c/ Turbo 4.5GHz 288MB SktsWRX8', '7899.90', 'A arquitetura “Zen 3” pode extrair uma média de 19% de desempenho adicional de cada MHz de frequência em relação à geração anterior. Esta é uma melhoria geracional historicamente grande no IPC e um jogador importante na capacidade da arquitetura de fornecer desempenho de núcleo único incomparável.', '2022-07-12', 200, 'Components');
insert into Product (prodName, price, prodDescription, launchDate, stock, categoryName) values ('Processador Intel Core i9-13900K 24-Core 2.2GHz c/ Turbo 5.8GHz 36MB Skt1700', '759.90', 'Com um aumento na contagem de núcleos, estes processadores continuam a utilizar a arquitetura híbrida de desempenho Intel para otimizar os seus jogos, criação de conteúdo e produtividade. Aproveite a largura de banda líder do setor de até 16 vias PCIe 5.0 e memória DDR5 de até 5600 MT/s. Turbine o desempenho do seu CPU com um poderoso conjunto de ferramentas de ajuste e overclocking. Desfrute das suas experiências favoritas em até 4 monitores 4K60 simultâneos.', '2022-12-24', 200, 'Components');
insert into Product (prodName, price, prodDescription, launchDate, stock, categoryName) values ('Processador AMD Ryzen 9 7950X 16-Core 4.5GHz c/ Turbo 5.7GHz 81MB SktAM5', '709.90', 'Estejas renderizar em 3D uma cena com alto número de polígonos, exportando arquivos de vídeo massivos ou a visualizar um sonho arquitetónico, os processadores AMD Ryzen™ Série 7000 são construídos para vencer o relógio. Com conectividade que economiza tempo, como suporte de armazenamento PCIe® 5.0, tecnologia AMD EXPO™, muitas threads de processamento e aceleradores de vídeo dedicados, eleva a tua experiência com os processadores AMD Ryzen Série 7000.', '2022-03-06', 200, 'Components');
insert into Product (prodName, price, prodDescription, launchDate, stock, categoryName) values ('Placa Gráfica Asus GeForce RTX 4090 ROG Strix OC 24GB GDDR6X', '2521.90', 'NVIDIA® GeForce RTX® 4090 é o derradeiro GPU GeForce. Traz um enorme salto em desempenho, eficiência e gráficos com inteligência artificial. Usufrui de jogos de alto desempenho, mundos virtuais incrivelmente detalhados, produtividade sem precedentes e novas maneiras de criar. É alimentado pela arquitetura NVIDIA Ada Lovelace e vem com 24 GB de memória G6X para oferecer a melhor experiência para jogadores e criadores.', '2022-03-02', 200, 'Components');
insert into Product (prodName, price, prodDescription, launchDate, stock, categoryName) values ('Memória RAM Corsair Vengeance RGB Pro 16GB (2x8GB) DDR4-3600MHz CL18 Preta', '69.90', 'As memórias DDR4 VENGEANCE RGB PRO Series com overclocking iluminam o seu PC com luzes RGB dinâmicas multizona enquanto oferece o melhor desempenho.', '2021-08-11', 200, 'Components');
insert into Product (prodName, price, prodDescription, launchDate, stock, categoryName) values ('Televisão LG Série C2 SmartTV 55" OLED evo 4K UHD', '1179.90', 'Maximizámos a beleza e a vivacidade dos píxeis autoiluminados LG OLED. A funcionalidade Brightness Booster eleva as capacidades do processador a9 Gen 5 AI a um novo patamar, proporcionando níveis de brilho superiores em 20%. Agora, as imagens tornam-se ainda mais poderosas, graças a uma maior eficiência e controlo da luz.', '2022-11-09', 200, 'TVs');
insert into Product (prodName, price, prodDescription, launchDate, stock, categoryName) values ('Televisão Samsung QN900B SmartTV 75" Neo QLED 8K UHD', '5999.90', 'A evolução da Neo QLED conta com a Tecnologia Quantum Matrix, que controla de forma precisa cada um dos nossos novos e exclusivos Quantum Mini LEDs. Com um controlo de luz minuncioso, pode desfrutar de grandes detalhes tanto em cenas escuras como claras.', '2022-12-17', 200, 'TVs');
insert into Product (prodName, price, prodDescription, launchDate, stock, categoryName) values ('Frigorífico Americano Samsung RS68A8821S9 634 Litros E Inox', '1049.99', 'Frigorífico americano RS68A8821S9/EF da Samsung utiliza dois fluxos de ar independentes e um controlo de temperatura de grande precisão para garantir os níveis de humidade ideais em todas as zonas do frigorífico.Este frigorífico americano vem com dispensador minimalista e ecrã oculto, que complementam o design moderno da parte frontal. O dispensador está harmoniosamente integrado na porta para que consigas facilmente água fresca ou gelo.', '2021-10-03', 200, 'Other');
insert into Product (prodName, price, prodDescription, launchDate, stock, categoryName) values ('Frigorífico Combinado Samsung RL4363FBASL 432 Litros F Inox', '879.90', 'Conserve os seus alimentos e, ao mesmo tempo, o ambiente. As tecnologias eficientes, como o Compressor Digital Inverter ou a iluminação LED, ajudam a preservar energia, a reduzir a emissão de gases com efeito estufa e a diminuir a despesa de eletricidade', '2022-05-09', 200, 'Other');
insert into Product (prodName, price, prodDescription, launchDate, stock, categoryName) values ('Aspirador Robô Ecovacs Deebot X1 OMNI 5000Pa Preto', '1699.00', 'O DEEBOT X1 OMNI proporciona-lhe uma experiência totalmente livre de mãos com a primeira estação OMNI All-in-One da indústria.', '2021-11-14', 200, 'Other');
insert into Product (prodName, price, prodDescription, launchDate, stock, categoryName) values ('Máquina de Café Automática DeLonghi PrimaDonna Elite Experience ECAM650.85.MS 1450W 19 Bar', '1479.90', 'Eleve a preparação de café a um novo patamar com a PrimaDonna Elite Experience. O acabamento elegante em aço inoxidável e o ecrã tátil vibrante chamará primeiro a sua atenção, seguindo-se as suas funcionalidades inovadoras. Ligue-se via Bluetooth à App Coffee Link para criar e personalizar novas receitas. Escolha entre uma grande variedade de bebidas para desfrutar do seu café favorito em casa.', '2022-09-01', 200, 'Other');
insert into Product (prodName, price, prodDescription, launchDate, stock, categoryName) values ('Impressora Multifunções Epson EcoTank ET-16600', '1199.00', 'Esta impressora EcoTank com várias funcionalidades facilita as tarefas em formato A3+ e oferece um custo por página reduzido. Os trabalhos em formato A3+ podem ser realizados rapidamente graças às velocidades de impressão e digitalização rápidas, dois tabuleiros de papel com alimentação frontal com capacidade para 250 folhas, alimentação posterior de 50 folhas e ADF de 50 folhas A3. Imprima como quiser com a impressão móvel, Ethernet e um ecrã tátil LCD de 10,9 cm com teclas.', '2021-09-08', 200, 'Other');
insert into Product (prodName, price, prodDescription, launchDate, stock, categoryName) values ('Impressora Monocromática HP LaserJet Tank 2504dw Wireless', '329.99', 'Obtenha o menor custo de operação com toner pré-carregado que permite imprimir até 5000 páginas e poupe com o Kit de Recarga de Toner HP.', '2022-11-06', 200, 'Other');insert into Product (prodName, price, prodDescription, launchDate, stock, categoryName) values ('ElFlores Gaming Desktop Special Edition', '2018.57', 'in felis eu sapien cursus vestibulum proin eu mi nulla ac enim in tempor turpis nec euismod scelerisque quam turpis adipiscing lorem vitae mattis nibh ligula nec sem duis aliquam convallis nunc proin', '2021-05-04', 200, 'Desktops');
